import './App.css';

import { useApi } from './hooks/use-api';
import {useState} from 'react';



function Hey(){
  const [count, setCount] = useState(0);
  const [active, setActive] = useState(false);
  let colors={};
  function handleClick(){
    setCount(count+1);
    setActive(!active);
    colors={color:"100+{count},0,0}"}
  }
  return(
    <button className='heyButton' onClick={handleClick}
    style={{  
      backgroundColor: active ? "black" : "rgb("+colors.color+")"
    }}

    >
      This it + {count} + {colors.color}
    </button>
   );
  }


function App() {
  const { response } = useApi();

  return (
    <div className="App">
      <header className="App-header">
        <Hey/>
        <p>
          {response}
        </p>
      </header>
    </div>
  );
}

export default App;
